import './css/SearchBarComponent.css';
import React from 'react';

export class SearchBarComponent extends React.Component {

    constructor(props) {
        super(props);
        this.state = {
            guess_val: "",
            num_guesses: 0,
            guess_strings: []
        }
    }

    checkAns(e) {
        e.preventDefault();
        fetch('blahblahblah')
        .then()

    }

    render() {
        return (
            <div>
            <div class="box">
                <form name="search">
                    <input type="text" style={{caretColor: 'transparent'}} placeholder="Guess Here" id='search' class="input" name="txt" onMouseOut={(e) => this.blurVal(e)} onKeyUp={(e)=>this.checkAns(e)} />
                </form>
            </div>
            <div hidden={this.state.num_guesses < 1}>

            </div>
            <div hidden={this.state.num_guesses < 2}>

            </div>
            <div hidden={this.state.num_guesses < 3}>

            </div>
            <div hidden={this.state.num_guesses < 4}>

            </div>
            <div hidden={this.state.num_guesses < 5}>

            </div>
            <div hidden={this.state.num_guesses < 6}>

            </div>
            <div hidden={this.state.num_guesses < 7}>

            </div>
            </div>
        )
    }

    blurVal(e) {
        e.preventDefault();
        document.getElementById('search').value = "";
    }

}
